import React from "react";
import { Link } from "react-router-dom";
import "./Navbar.css"

const NavigationBar = () => {
    return (
        <header>
            <nav className="nav-bar">
                <Link clato="/">Home</Link>
                <Link to="/posts">Posts</Link>
                <Link to="/profile">Profile</Link>
            </nav>
        </header>
    )
}

export default NavigationBar
